{"Q0":"I'd love for our material to be as relevant as possible for our students, so I want to draw on more of the music they already know and like. (That obviously varies widely, depending on the student.) I also want to challenge them to appreciate music that is not in their cultural bubble. To some extent, I can meet both needs to some degree by surveying the class about their tastes at the start, and by integrating my own experience and taste.

We are in the process of shifting our curriculum to reflect more popular music and to ensure a wide diversity of voices.

If I had the opportunity, I would like to be able to reach beyond pitch and rhythm based requirements for aural skills. But, I do find them necessary for musicianship, and many students seem to need the entire sequence just to attain some basic fluency with those skills."}

{"Q0":"Teacher provides protonotation (or solfege syllables) and prompts students to produce the indicated melody, either using a given or chosen starting pitch. I often use this as a point and sing, where I point at the solfege and the class sings together on solfege using a given starting note.

Also, just thought of another activity that I use a LOT and is perhaps the most successful thing I do to develop relative pitch: singing into the key (Karpinski-style)!  This helps students be so much more successful in their sight reading and prepared singing.

My rating is for the first exercise I described here."}
